// TodoList.js
import React from 'react';

const TodoList = ({ todos, deleteTodo }) => {

  return (
    <ul>
      {todos.map(todo => (
        <>
        <li key={todo.id}>
          {todo.text}

        </li>
        <button onClick={() => deleteTodo(todo.id)}>Delete</button>
        </>
      ))}
    </ul>
  );
};

export default TodoList;
